import React from "react";

const SubForm = ()=>{
    return(
        <div className="sub-form-container">
            <input type="text" placeholder="Enter name" />
            <input type="text" placeholder="Any Suggestions for website..." />
            <button>Submit</button>
        </div>
    )
}

export default SubForm;
